
from time import time
t = time()


class Solution:
    def magnificentSets(self, n: int, edges) :
        n+=1
        g=[[] for _ in range(n)]
        for i,j in edges:
            g[i].append(j)
            g[j].append(i)
        print(time()-t)
        block = [-1]*n
        no=0
        def dfs(cur,no):            
            if block[cur]!=-1:return
            block[cur]=no
            for i in g[cur]:
                dfs(i,no)
        for i in range(n):
            if block[i]!=-1:continue
            dfs(i,no)
            no+=1
        eb=[0]*no
        print(time()-t)
        for i in range(1,n):
            group=[-1]*n
            q,no=[i],0
            yes=True
            while q!=[] and yes:
                nex=[]
                for i in q:
                    if not yes:break
                    group[i]=no
                    for ne in g[i]:
                        if group[ne]!=-1 :
                            if group[ne]==no-1:
                                continue
                            # print('err:',group,i,ne)
                            yes=False
                            break
                        else:
                            nex.append(ne)
                q=nex
                no+=1
            if yes:eb[block[i]]=max(eb[block[i]],no)
        print(time()-t)
        return sum(eb) if sum(eb) != 0 else -1

